import React from 'react'

const Button = (props) => {
  return (
    <button className='bg-red-500 hover:bg-red-400 text-white text-sm leading-6 font-medium py-2 px-3 w-24 rounded-lg'>
        {props.children}
    </button>
  )
}

export default Button
